import React from "react";
const Login = () => {
    const [company_id, setCompanyid] = useState("");
    const [password, setPassword] = useState("");
 return (
        <>
        <form action="">
        <div classname = "Login_Layout">
            <h1> <b> Welcome to Login Page  </b></h1>
            <h1> Enter Your Credentials </h1>
                 <label> <h2> Company Id </h2>
                <br/>
                   <input type="numbers" id="company_id" name="company_id" autoComplete="off" value={company_id}/>
                 </label>
                <br/>
                </div>
                <div>
                <label> <h2> Password </h2>
                <br/>
                    <input type="password" id="password" name="password" autoComplete="off" value={password}/>
                </label>
        </div>
        <button type = "Login"> Login </button>
        </form>
        </>
        );
}
export default Login;
